query:
(
    /* Meraki Scanning API v3 Clients with AP Details */

    /* -- Shortcut vars -- */
    $aps := $.`data`.`reportingAps`;
    $clients := $.`data`.`observations`;

    /* -- Helper Functions -- */
    /* Find an AP by MAC */
    $findApDetails := function($apMac){
                        $filter($aps, function($v) {
                            $v.mac = $apMac
                        }
                    )};

    /* -- Final Results -- */
    {
        "networkId":$.data.networkId,
        "startTime": $.data.startTime,
        "endTime":$.data.endTime,
        "stats": {
            "clientCount":$count($clients),
            "apCount":$count($aps)
        },
        "clients": $clients^(clientMac).{
        "clientMac":clientMac,
        "name":name,
        "bleBeacons":bleBeacons,
        /* use known locations first then default to APs location sort by time */
        "locations":locations ? locations^(>time).{
            "lat":lat,
            "lng":lng,
            "time":time
        } : $findApDetails(latestRecord.nearestApMac).{
            "lat":lat,
            "lng":lng
        },
        "lastRecord": latestRecord.time,
        "apDetails": $findApDetails(latestRecord.nearestApMac)
        }
    }


)
